import React from "react";
import "./App.css";


function AthleteList ({ athletes, setSelectedAthlete }) {

    function handleClick(e) {
        setSelectedAthlete(e.target.id)
    }

    const alphaOrder = athletes.sort((a, b) => a.name.localeCompare(b.name) )

    return (
        <div id="athlete_list">
            <p>Name(id#)</p>
            {alphaOrder.map((athlete) => <p className="athlete_name" key={athlete.id} id={athlete.id} onClick={handleClick}>{athlete.name} ({athlete.id})</p>)}
        </div>
    )
}

export default AthleteList
